Labeling adalah proses menandai atau memberi label pada suatu objek. Berikut ini adalah contoh kode labeling:

// Label the object
var label = "MyObject";

// Create a label element
var labelElement = document.createElement("span");
labelElement.innerHTML = label;

// Append the label element to the object
document.getElementById("myObject").appendChild(labelElement);

def count_words(sentence):
    words = sentence.split()
    return len(words)

package main

import (
    "fmt"
    "strings"
)

func countWords(sentence string) int {
    words := strings.Fields(sentence)
    return len(words)
}

package com.example.demo.controller;

import com.example.demo.model.User;
import com.example.demo.service.UserService;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.*;

import java.util.List;

@RestController
@RequestMapping(*/user*)
public class UserController {

    @Autowired
    private UserService userService;

    @GetMapping(*/all*)
    public List<User> getAllUsers(){
        return userService.getAllUsers();
    }

    @PostMapping(*/add*)
    public void addUser(@RequestBody User user){
        userService.addUser(user);
    }

    @PutMapping(*/update*)
    public void updateUser(@RequestBody User user){
        userService.updateUser(user);
    }

    @DeleteMapping(*/delete/{id}*)
    public void deleteUser(@PathVariable int id){
        userService.deleteUser(id);
    }

}

